import React from 'react'
import { ChatEngine } from 'react-chat-engine'
import './App.css'

const App = () => {
  return (
    // <div>App</div>
    <ChatEngine 
    height = "100vh"
    projectID = "1f9563a3-637c-401c-a448-2e9054b7e3b2"
    userName="Sanchit"
    userSecret="sanchit@123"
    renderChatFeed = {(chatAppProps) => <ChatEngine {...chatAppProps}/>}
    >
    </ChatEngine>
  )
}
export default App
